// Routes.jsx
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Admin from "pages/Admin";
import NotFound from "pages/NotFound";
import ScrollToHash from "./components/ScrollToHash";
import withStyles from "./withStyles"; // <-- Import the withStyles HOC

// Lazy load the components and their styles
const Newsfeed = React.lazy(() => import("pages/Newsfeed"));
const Waitlist = React.lazy(() => import("pages/Waitlist"));
const Landingpage = React.lazy(() => import("pages/Landingpage"));

const ProjectRoutes = () => {
  return (
    <React.Suspense fallback={<>Loading...</>}>
      <Router>
        <ScrollToHash />
        <Routes>
          <Route path="*" element={<NotFound />} />
          <Route
            path="/"
            element={withStyles(<Landingpage />, ["pages/Landingpage/Landingpage.css"])}
          />
          <Route
            path="/waitlist"
            element={withStyles(<Waitlist />, ["pages/Waitlist/Waitlist.css"])}
          />
          <Route
            path="/newsfeed"
            element={withStyles(<Newsfeed />, ["pages/Newsfeed/Newsfeed.css"])}
          />
          <Route
            path="/admin"
            element={withStyles(<Admin />, ["pages/Admin/admin.css"])}
          />
        </Routes>
      </Router>
    </React.Suspense>
  );
};

export default ProjectRoutes;
